import React from 'react'
import './PollsTable.less'

import QuestionPollItem from './QuestionPollItem'

class PollsTable extends React.PureComponent {

  render() {
    return (
      <div className='wrapper-poll-table'>
        <div className='poll-table'>
          <div className='header-poll-table'>
            <span className='title'>Title</span>
            <span className='total-question'>Total Questions</span>
            <span className='anonymous'>Anonymous</span>
            <span className='status' />
          </div>
          <div className='body-poll-table'>
            {
              this.props.webinarPolls.map((item, index) => {
                return (
                  <QuestionPollItem key={index} dataPoll={item} />
                )
              })
            }
          </div>
        </div>
      </div>
    )
  }
}

export default PollsTable
